export function load(cb) {
    window.gapi.client.load('sheets', 'v4', () => {
      window.gapi.client.sheets.spreadsheets.values.get({
        spreadsheetId: config.spreadsheetId,
        range: 'A2:E'
      }).then((response) => {
          console.log('something')
      })
    })
}
